    const { data: worldData, isLoading: isLoadingWorldData, isSuccess: isSuccessWorldData } = useGetWorldDataQuery();

    const handleChange = () =>{
        console.log('changing')
    }
    return (
        <div id="location-search">
            <Search/>
            <input  
                type="search" 
                name="q" 
                placeholder={"Search country, state, city... "}
                onChange={() => handleChange()}
            />
        </div>

    )
}

